import { useState } from "react";
import data from "../data.js";

function Main (){

    return(
    <div>
    <h1>심리테스트</h1>
    {
      data.map(item=>( <Food key={data.id} name={data.answer}/>))}
        
    </div>
    )
}

export default Main;
